import React, {setState} from 'react';
import Button from '../Button';
import Stage from '../Stage';
import Cards from '../Cards';
import data from '../../data.json';
import './style.css';
import Design from '../../../src/desktop.png'



class App extends React.Component{ 


  render() {
    const [show, setShow] = setState(true)

    console.log(data)
    return (
      <div>
      <div className="container">
      <Stage data={data.page.components[0]} />
        <Cards data={data.page.components[1]} show={show}/>
        <Button data={data.page.components[2]} show={setShow} />

      </div>
      <img src={Design} style={{maxWidth:'100%'}}/>
      </div>
    );
  }
}

export default App;
